('6404ENV01', '6404ENV01-01', 'บริหารจัดการคุณภาพน้ำ ให้อยู่ในเกณฑ์มาตรฐาน สำหรับการอุปโภคบริโภค (WQI มากกว่า 61) ครอบคลุมพื้นที่ตามระยะการดำเนินการ(ระยะที่ 1) รอยต่อระหว่างแหล่งน้ำธรรมชาติในชุมชนและแม่น้ำบางปะกง ในบริเวณต.ท่าข้าม อ.บางปะกง(ระยะที่ 2) ตลอดระยะลำน้ำแม่น้ำบางปะกงที่ผ่าน อ.บางปะกง(ระยะที่ 3) ตลอดระยะลำน้ำแม่น้ำบางปะกง ตั้งแต่อ.เมืองฉะเชิงเทรา - อ.บางปะกง', '61', 'WQI มากกว่า 61'),
('6404ENV01', '6404ENV01-02', 'ลดความเสียหายในภาคเกษตรกรรม ด้วยผลคาดการณ์ปริมาณน้ำในเขื่อนและอ่างเก็บน้ำได้ล่วงหน้าอย่างน้อย 7 วัน ผ่าน App. ครอบคลุมพื้นที่ทั้งหมดของโครงการ', '7', 'วัน'),
('6404ENV01', '6404ENV01-03', 'แจ้งเตือนเมื่อมีแนวโน้มที่จะเกิดวิกฤตทางทรัพยากรน้ำแก่ประชาชน ผ่าน App. ครอบคลุมพื้นที่ทั้งหมดของโครงการ', '0', ''),
('6404ENV02', '6404ENV02-01', 'ติดตั้งอุปกรณ์ตรวจวัดคุณภาพน้ำ-ระดับน้ำ ครอบคลุมพื้นที่ตลอดระยะลำน้ำแม่น้ำบางปะกง ซึ่งแบ่งดำเนินการเป็นระยะ(ระยะที่ 1) ติดตั้งเครื่องตรวจวัดคุณภาพน้ำ ทั้งหมด ๖ สถานี ที่เป็นรอยต่อระหว่างแหล่งน้ำธรรมชาติในชุมชนและแม่น้ำบางปะกง ในบริเวณ ต.ท่าข้าม อ.บางปะกง(ระยะที่ 2) ติดตั้งเครื่องตรวจวัดคุณภาพน้ำ ทั้งหมด ๗ สถานี ตลอดระยะลำน้ำแม่น้ำบางปะกงที่ผ่าน อ.บางปะกง(ระยะที่ 3) ติดตั้งเครื่องตรวจวัดคุณภาพน้ำ ทั้งหมด ๒๐ สถานี ตลอดระยะลำน้ำแม่น้ำบางปะกง ตั้งแต่อ.เมืองฉะเชิงเทรา - อ.บางปะกง', '33', 'สถานี'),
