('6404ENV03', '6404ENV03-01', 'บริหารจัดการคุณภาพอากาศ อยู่ในเกณฑ์ดี สามารถทำกิจกรรมกลางแจ้งและการท่องเที่ยวได้ตามปกติ (AQI น้อยกว่า 50) ครอบคลุมพื้นที่ตามระยะการดำเนินการ(ระยะที่ 1) พื้นที่ชุมชน อุตสาหกรรมและโรงไฟฟ้า (ระยะ ๕ กิโลเมตรรอบเขตโรงไฟฟ้าบางปะกง)(ระยะที่ 2) พื้นที่ชุมชนและสวนสาธารณะ(ระยะที่ 3) พื้นที่ชุมชนโดยรอบนิคมอุตสาหกรรมในจังหวัดฉะเชิงเทรา', '50', 'AQI น้อยกว่า 50'),
