('6404ENV04', '6404ENV04-01', 'ติดตั้งอุปกรณ์ตรวจวัดคุณภาพอากาศ ครอบคลุมพื้นที่ไม่น้อยกว่าร้อยละ ๗๐ ของพื้นที่ ซึ่งแบ่งดำเนินการเป็นระยะ(ระยะที่ 1) พื้นที่ชุมชน อุตสาหกรรมและโรงไฟฟ้า (ระยะ 5 กิโลเมตรรอบเขตโรงไฟฟ้าบางปะกง)(ระยะที่ 2) พื้นที่ชุมชนและสวนสาธารณะ ในเขต อ. เมืองฉะเชิงเทรา(ระยะที่ 3) พื้นที่ชุมชนโดยรอบนิคมอุตสาหกรรมในจังหวัดฉะเชิงเทรา', '70', 'ร้อยละ'),
