('6221ENE04', '6221ENE04-01', 'ส่งเสริมให้เอกชนเข้ามามีส่วนร่วมในการบริหารจัดการและกำจัดมูลฝอย รวมถึงขั้นตอนการผลิตพลังงานทดแทน', '0', ''),
('6221ENE04', '6221ENE04-02', 'ผลิตพลังงานทางเลือกจากขยะได้ 2,136 เมกะวัตต์ต่อปี', '2136', 'เมกะวัตต์ต่อปี'),
('6209LIV04', '6209LIV04-01', 'มีผู้สูงอายุและผู้ป่วยกลุ่มเปราะบางในพื้นที่ลงทะเบียนเข้าสู่ระบบการบริการสาธารณสุขและฐานข้อมูลของเทศบาลเป็นจำนวน 100 %', '100', '%'),
('6209LIV04', '6209LIV04-02', 'ลดจำนวนการนัดหมายทางการแพทย์โดยไม่จำเป็นลงไม่ต่ำกว่า 20% ของการนัดหมาย', '20', '% ของการนัดหมาย'),
('6209LIV04', '6209LIV04-03', 'ลดระยะเวลาการวินิจฉัยของแพทย์และการเข้ารับบริการด้านสุขภาพของผู้สูงอายุและกลุ่มเปราะบางลงได้ไม่ต่ำกว่า 20% /คน/ครั้ง', '20', '% /คน/ครั้ง'),
('6209LIV04', '6209LIV04-04', 'ผู้ใช้บริการ (บุคลากรทางการแพทย์ , อสม. , ผู้ป่วยและญาติผู้ป่วย) มีความพึงพอใจโดยรวมต่อระบบสาธารณสุขอัจฉริยะอยู่ในระดับมาก เป็นจำนวน 90 % ของผู้ใช้บริการทั้งหมด', '90', '% ของผู้ใช้บริการทั้งหมด'),
('6223ENE03', '6223ENE03-01', 'ระบบ Mini Grid 1 ระบบ และ ระบบ Solar Home สำหรับพื้นที่ อบต.เกาะสาหร่าย (เกาะบุโหลนเล)', '1', 'ระบบ'),
('6410ENV04', '6410ENV04-01', 'ระบบป้องกันและแก้ไขปัญหาน้ำท่วม 1 ระบบ', '1', 'ระบบ'),
